"use strict";var UIElements={init:function(){$(".rating, .rating-tooltip").each(function(){$(this).val()>0?$(this).next(".badge").show().text($(this).val()||" "):$(this).next(".badge").hide()}),$(".rating-tooltip").rating({extendSymbol:function(t){$(this).tooltip({container:"body",placement:"bottom",title:"Rate "+t})}}),$(".rating, .rating-tooltip").on("change",function(){$(this).next(".badge").show().text($(this).val())})}};